import React from 'react'

type Props = {}

const Card = (props: Props) => {
  return (
  <div className="card">
    <img 
        src="https://i.guim.co.uk/img/media/9e1633d73fcfdf20bbf77fecaef9256c8912843f/0_123_3691_2215/master/3691.jpg?width=465&dpr=1&s=none&crop=none"
        alt="Image"
    />
    <div className="details">
        <h2> Virat kohli h/o Anshuka Sharma</h2>
        <p>Indian Cricketer</p>
    </div>
    <p className='info'>This moment the IPL win is right up there with the best moments I've had in my career, but it's still marks five levels under Test cricket.</p>
  </div>
  
  );
}

export default Card;
